import React from "react";
import MyTypography from "../MyTypography";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";
import { useStyles } from "../style";
import { Link } from "react-router-dom";
import { useDispatch } from "react-redux";
import axios from "axios";
function TopBarAuth(props) {
  const classes = useStyles();
  const dispatch = useDispatch();

  let token = "";
  if (localStorage.getItem("currentUser")) {
    console.log(123);
    token = JSON.parse(localStorage.getItem("currentUser")).token;
    axios({
      url: `http://localhost:5000/api/v1/auth/me`,
      method: "GET",
      headers: {
        Authorization: `Bearer ${token}`,
      },
    })
      .then((result) => {
        console.log(result);
      })
      .catch((error) => {
        console.log(error);
      });
  }

  return (
    <>
      <Link
        to="/sign-in"
        justify="flex-end"
        className={classes.headAuthItems}
        item
        lg={6}
      >
        <AccountCircleIcon fontSize="large" className={classes.authIcon} />
        <MyTypography>Đăng Nhập</MyTypography>
      </Link>

      <Link
        to="/sign-up"
        justify="flex-end"
        className={classes.headAuthItems}
        item
        lg={6}
      >
        <AccountCircleIcon fontSize="large" className={classes.authIcon} />
        <MyTypography>Đăng Ký</MyTypography>
      </Link>
    </>
  );
}

export default TopBarAuth;
